import React from "react";
import { connect } from "react-redux";


const mapStateToProps = (state) => {
  return {
    getLoggingList: state.inventorys.getLoggingList,
    errorLoggingList: state.inventorys.errorLoggingList,
    HitungLogging: state.inventorys.getLoggingList.length,
  };
};

const File1 = (props) => {
  let a29 = 0;
  let a1 = 0;
  let a10 = 0;
  for (let i = 0; i < props.HitungLogging; i++) {
    if (props.getLoggingList[i].qty === 29) {
      a29 = a29 + props.getLoggingList[i].qty;
    }
    if (props.getLoggingList[i].qty === 1) {
      a1 = a1 + props.getLoggingList[i].qty;
    }
    if (props.getLoggingList[i].qty === 10) {
      a10 = a10 + props.getLoggingList[i].qty;
    }
  }

  return (
    <div>
      {a29}
      <br></br>
      {a1}
      <br></br>
      {a10}
    </div>
  );
};

export default connect(mapStateToProps, null)(File1);
